import React from 'react';
import { PackshotsLogo, ApproveLogo, CapilanoLogo, EskoLogo } from "../images/product-logos";
const appsMetadata = {
    "approve": {
        title: "Share And Approve",
        urlTemplate: params => `${params.appOrigin}/sites/${params.repoId}/${params.workspace}`,
        logo: React.createElement(ApproveLogo, null),
        key: "approve"
    },
    "capilano": {
        title: "Capilano",
        urlTemplate: params => `${params.appOrigin}/`,
        logo: React.createElement(CapilanoLogo, null),
        key: "capilano"
    },
    "packshots": {
        title: "Packshots",
        urlTemplate: params => `${params.appOrigin}/sites/${params.repoId}/${params.workspace}`,
        logo: React.createElement(PackshotsLogo, null),
        key: "packshots"
    },
    "esko": {
        title: "Esko-Graphics",
        urlTemplate: params => "http://esko.com",
        logo: React.createElement(EskoLogo, null),
        key: "esko"
    }
};
export default appsMetadata;
